import React from 'react';
import styled from "styled-components"

const TopBarDesign = styled.header`
    background-color: skyblue;
    margin: 0;
    padding: 10px;
    position: fixed;
    height: 60px;
    width: 100%;
    font-size: 1.1rem;

`;

const TopBar = ({title}) => {
    return <TopBarDesign>{title}</TopBarDesign>
}

export default TopBar;
